import React from 'react';
import {
  Box,
  Typography,
  Paper,
  Switch,
  Slider,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  IconButton,
} from '@mui/material';
import { styled } from '@mui/material/styles';
import LightbulbIcon from '@mui/icons-material/Lightbulb';
import Brightness6Icon from '@mui/icons-material/Brightness6';
import WbSunnyIcon from '@mui/icons-material/WbSunny';
import NightsStayIcon from '@mui/icons-material/NightsStay';
import AutoAwesomeIcon from '@mui/icons-material/AutoAwesome';

const RoomCard = styled(Paper)<{ isActive?: boolean }>(({ theme, isActive }) => ({
  padding: theme.spacing(2),
  marginBottom: theme.spacing(2),
  background: isActive
    ? theme.palette.mode === 'dark'
      ? 'linear-gradient(45deg, #9c27b0 30%, #ba68c8 90%)'
      : 'linear-gradient(45deg, #2196f3 30%, #64b5f6 90%)'
    : 'transparent',
  color: isActive ? '#fff' : theme.palette.text.primary,
  border: isActive ? 'none' : `1px solid ${theme.palette.divider}`,
  transition: 'all 0.3s ease',
  '&:hover': {
    transform: 'scale(1.02)',
  },
}));

const ModeButton = styled(IconButton)<{ isActive?: boolean }>(({ theme, isActive }) => ({
  color: isActive ? '#fff' : theme.palette.text.primary,
  backgroundColor: isActive ? 'rgba(255, 255, 255, 0.1)' : 'transparent',
  '&:hover': {
    backgroundColor: isActive ? 'rgba(255, 255, 255, 0.2)' : 'rgba(0, 0, 0, 0.04)',
  },
}));

interface Room {
  id: string;
  name: string;
  deviceId: string;
  isOn: boolean;
  brightness: number;
  mode: 'day' | 'night' | 'auto';
}

interface LightsPageProps {
  rooms: Room[];
  onToggleRoom: (roomId: string) => void;
  onBrightnessChange: (roomId: string, value: number) => void;
  onModeChange: (roomId: string, mode: 'day' | 'night' | 'auto') => void;
}

const LightsPage: React.FC<LightsPageProps> = ({
  rooms,
  onToggleRoom,
  onBrightnessChange,
  onModeChange,
}) => {
  return (
    <Box sx={{ pb: 7 }}>
      <Typography variant="h4" gutterBottom>
        Управление освещением
      </Typography>

      {rooms.map((room) => (
        <RoomCard key={room.id} isActive={room.isOn}>
          <Box display="flex" alignItems="center" justifyContent="space-between" mb={2}>
            <Box>
              <Typography variant="h6">{room.name}</Typography>
              <Typography variant="body2" color="text.secondary">
                ID устройства: {room.deviceId}
              </Typography>
            </Box>
            <Switch
              checked={room.isOn}
              onChange={() => onToggleRoom(room.id)}
              color="primary"
            />
          </Box>

          <Box sx={{ px: 2 }}>
            <Typography gutterBottom>Яркость</Typography>
            <Box display="flex" alignItems="center" gap={1}>
              <Brightness6Icon />
              <Slider
                value={room.brightness}
                onChange={(_, value) => onBrightnessChange(room.id, value as number)}
                min={0}
                max={100}
                step={1}
                valueLabelDisplay="auto"
                valueLabelFormat={(value) => `${value}%`}
                sx={{ flex: 1 }}
              />
            </Box>
          </Box>

          <Box display="flex" justifyContent="center" gap={1} mt={2}>
            <ModeButton
              isActive={room.mode === 'day'}
              onClick={() => onModeChange(room.id, 'day')}
              size="small"
            >
              <WbSunnyIcon />
            </ModeButton>
            <ModeButton
              isActive={room.mode === 'night'}
              onClick={() => onModeChange(room.id, 'night')}
              size="small"
            >
              <NightsStayIcon />
            </ModeButton>
            <ModeButton
              isActive={room.mode === 'auto'}
              onClick={() => onModeChange(room.id, 'auto')}
              size="small"
            >
              <AutoAwesomeIcon />
            </ModeButton>
          </Box>
        </RoomCard>
      ))}
    </Box>
  );
};

export default LightsPage;
